"""
@author : zenithude

Online Stock Span

Write a class StockSpanner which collects daily price quotes for some stock, and returns the span of that stock's price for the current day.

The span of the stock's price today is defined as the maximum number of consecutive days (starting from today and going backwards) for which the price of the stock was less than or equal to today's price.

For example, if the price of a stock over the next 7 days were [100, 80, 60, 70, 60, 75, 85], then the stock spans would be [1, 1, 1, 2, 1, 4, 6].

Example 1:

Input: ["StockSpanner","next","next","next","next","next","next","next"],
[[],[100],[80],[60],[70],[60],[75],[85]]
Output: [null,1,1,1,2,1,4,6]
Explanation: First, S = StockSpanner() is initialized.  Then:
S.next(100) is called and returns 1,
S.next(80) is called and returns 1,
S.next(60) is called and returns 1,
S.next(70) is called and returns 2,
S.next(60) is called and returns 1,
S.next(75) is called and returns 4,
S.next(85) is called and returns 6.

Note that (for example) S.next(75) returned 4, because the last 4 prices (including today's price of 75) were less than or equal to today's price.

Note:

Calls to StockSpanner.next(int price) will have 1 <= price <= 10^5. There will be at most 10000 calls to StockSpanner.next per test case. There will be at most 150000 calls to StockSpanner.next across all test cases. The total time limit for this problem has been reduced by 75% for C++, and 50% for all other languages.

"""


class StockSpanner1:
    """ Trop lent """

    def __init__(self):
        self.stock = []

    def next(self, price: int) -> int:
        self.stock.append(price)
        S = [0 for i in range(len(self.stock))]
        S = self.calculateSpan(self.stock, S)
        return S[-1]

    def calculateSpan(self, stock, S):
        n = len(stock)
        # Create a stack and push index of fist element to it
        st = [0]

        # Span value of first element is always 1
        S[0] = 1

        # Calculate span values for rest of the elements
        for i in range(1, n):

            # Pop elements from stack whlie stack is not
            # empty and top of stack is smaller than price[i]
            while len(st) > 0 and stock[st[-1]] <= stock[i]:
                st.pop()

            # If stack becomes empty, then price[i] is greater
            # than all elements on left of it, i.e. price[0],
            # price[1], ..price[i-1]. Else the price[i] is
            # greater than elements after top of stack
            S[i] = i + 1 if len(st) <= 0 else (i - st[-1])

            # Push this element to stack
            st.append(i)
        return S


class StockSpanner:

    def __init__(self):
        self.prices = []
        self.spans = []

    def next(self, price):
        """
        :param price: int
        :return: int
        """
        index = len(self.prices) - 1
        while index >= 0 and self.prices[index] <= price:
            span = self.spans[index]
            index -= span

        self.prices.append(price)
        span = len(self.prices) - 1 - index
        self.spans.append(span)

        return span


